'use strict';

function Weapon(game, player, config) {
  var isAnimated = !!config.sprites;
  var graphicKey = isAnimated ? config.sprites.bullet.animationName : config.images.bullet;

  var weapon = game.add.weapon(config.fireLimit, graphicKey);


  if (isAnimated) {
    var spriteConfig = config.sprites.bullet;
    weapon.bulletFrameCycle = false;
    weapon.addBulletAnimation(spriteConfig.animationName,
      spriteConfig.frames,
      spriteConfig.frameRate,
      false,
      true
    );
  }

  var bulletKillType = Phaser.Weapon.KILL_WORLD_BOUNDS;
  if (config.range) {
    weapon.bulletKillDistance = config.range;
    bulletKillType = Phaser.Weapon.KILL_DISTANCE;
  }
  weapon.bulletKillType = bulletKillType;
  weapon.bulletSpeed = config.bulletSpeed;
  weapon.bulletAngleOffset = 90;
  weapon.fireRate = config.reloadTime;
  weapon.trackSprite(player, 0, 0, false);
  if (config.sound) {
    var fireSound = game.add.audio(config.sound);
    weapon.onFire.add(function () {
      fireSound.play();
    });
  }
  return weapon;
}

module.exports = {
  create: function (game, player, weapon) {
    return new Weapon(game, player, weapon);
  }
};

'use strict';

var config = require('./enemy.conf');
var Weapon = require('./weapon');

function Enemy(game, spawnInfo) {
  var flySpriteConfig = config.sprites.enemy;

  var enemy = game.add.sprite(spawnInfo.x[0], spawnInfo.y[0], flySpriteConfig.animationName);
  game.physics.enable(enemy, window.Phaser.Physics.ARCADE);
  enemy.anchor.setTo(0.5, 0.5);

  enemy.weapon = Weapon.create(game, enemy, require('./weapon1.conf'));
  enemy.weapon.fireAngle = 90;

  enemy.animations.add(flySpriteConfig.animationName);

  var timeToFlyMotionPath = spawnInfo.time;
  var paths = { x: spawnInfo.x, y: spawnInfo.y };
  var spawnTime = game.time.physicsElapsedTotalMS;

  function move() {
    var timePassed = game.time.physicsElapsedTotalMS - spawnTime;
    var step = 0;
    if (timePassed) {
      step = timePassed / timeToFlyMotionPath;
    }
    if (step > 1) {
      enemy.destroy();
    }
    var newX = game.math.catmullRomInterpolation(paths.x, step);
    var newY = game.math.catmullRomInterpolation(paths.y, step);
    enemy.x = newX;
    enemy.y = newY;
    attackSprite.x = newX;
    attackSprite.y = newY;
  }

  enemy.update = function () {
    if (enemy.alive) {
      move();

      if (game.random.rollForChancePerSecond(config.chanceToShootPerSecondInPercent)) {
        enemy.attack();
      }
    }
  };

  var attackConfig = config.sprites.death;
  var attackSprite = game.add.sprite(enemy.body.x, enemy.body.y, attackConfig.animationName);
  attackSprite.anchor.setTo(0.5, 0.5);
  attackSprite.visible = false;
  enemy.animations.add(attackConfig.animationName);

  enemy.attack = function () {
    attackSprite.frame = 1;
    attackSprite.visible = true;
    enemy.animations.play(attackConfig.animationName, attackConfig.frameRate);
    enemy.animations.currentAnim.onComplete.add(function () {
      attackSprite.visible = false;
      enemy.weapon.fire();
      enemy.frame = 1;
      enemy.animations.play(flySpriteConfig.animationName, flySpriteConfig.frameRate, true);
    });
  };

  function playDeathAnimation() {
    var deathConfig = config.sprites.death;
    var death = game.add.sprite(enemy.body.x, enemy.body.y, deathConfig.animationName);
    death.anchor.setTo(0.5, 0.5);
    death.animations.add(deathConfig.animationName);
    death.frame = 1;
    death.animations.play(deathConfig.animationName,
      deathConfig.frameRate,
      false,
      true);
  }

  enemy.events.onKilled.add(playDeathAnimation);

  return enemy;
}

module.exports = {
  create: function (game, pos) {
    return new Enemy(game, pos);
  }
};

'use strict';

var configs = [
  require('./debris1.conf'),
  require('./debris2.conf')
];

function Debris(game, pos) {
  var config = game.random.sample(configs);
  var spriteConfig = game.random.sample([
    config.sprites.debris,
    config.sprites.debrisInverted
  ]);

  var speed = game.random.sample(config.speeds);
  var debris = game.add.sprite(pos.x, pos.y, spriteConfig.animationName);
  game.physics.enable(debris, window.Phaser.Physics.ARCADE);
  debris.anchor.setTo(0.5, 0.5);

  debris.animations.add(spriteConfig.animationName, spriteConfig.frames);
  debris.frame = game.random.sample(spriteConfig.frames);
  debris.animations.play(spriteConfig.animationName, spriteConfig.frameRate, true);

  debris.destroysItselfOnHit = true;

  function move() {
    debris.y += speed;
  }

  debris.update = function () {
    if (debris.alive) {
      move();
    }
  };

  function playDeathAnimation() {
    var explosion = game.add.sprite(debris.body.x, debris.body.y, config.sprites.explode.animationName);
    explosion.anchor.setTo(0.5, 0.5);
    explosion.animations.add(
      config.sprites.explode.animationName);
    explosion.frame = 1;
    explosion.animations.play(config.sprites.explode.animationName,
      config.sprites.explode.frameRate,
      false,
      true);
  }

  debris.events.onKilled.add(playDeathAnimation);

  return debris;
}

module.exports = {
  create: function (game, pos) {
    return new Debris(game, pos);
  }
};

'use strict';

